sourcesContent:
import styled from "styled-components";

export const Transaction = styled.div`
  background-color: black;
  width: 50%;
  float: right;
  color: white;

  .contain {
    display: block;
  }
  .contain .list {
    list-style: none;
    background-color: red;
  }
`;
